import React from "react";
import Header from "../layouts/Header";

const CartPage = ({cartCount}) => {
    return (
        <>
            <Header
                cartCount={cartCount} />
            <main className="p-8">
                <h1 className="text-3xl mt-4 mb-3">My Cart</h1>

                <div className="my-8 bg-white border-[1px] border-slate-300 rounded shadow-lg p-4">
                    <div className="flex"> 
                        <img src="https://fdn2.gsmarena.com/vv/pics/samsung/samsung-galaxy-s23-ultra-5g-1.jpg"
                            alt="Cart Product"
                            className="w-28 h-28" />

                            <div className="ms-4">
                                <h1 className="text-xl">Nama Product</h1>
                                <div className="text-sky-800">Rp 25.000.000</div>
                            </div>
                    </div>
                </div>
            </main>
        </>
    )
};

export default CartPage;
